  `id_orden_compra` int(11) DEFAULT NULL,
  `comentario_oi` varchar(45) DEFAULT NULL,
  `fecha_cancelacion_cliente` datetime DEFAULT NULL,
  `terminos_condiciones` varchar(1000) DEFAULT NULL,
  `impuesto_id` int(11) DEFAULT NULL,
  `numero_secuencia` varchar(10) DEFAULT NULL,
