CREATE DEFINER=`holinsys`@`%` PROCEDURE `usp_reporte_kardex`(IN `vFecha` DATETIME, IN `vCerrarKardex` INT)
BEGIN
    DECLARE vCreado INT;
    DECLARE vMes INT;
    DECLARE vAnio INT;
    DECLARE vPeriodo VARCHAR(6);
    SET vCreado = 0;
    SET vMes = MONTH(vFecha);
    SET vAnio = YEAR(vFecha);
    SET vPeriodo = CONVERT(DATE_FORMAT(vFecha ,'%Y%m'), UNSIGNED INTEGER);    
    /* Verificacion si el  kardex para el periodo dado ha sido cerrado. */
    SELECT 
    cerrado_kardex
INTO vCreado FROM
    inventario_mes
WHERE
    mes = vMes AND anio = vAnio;
    IF (vCreado = 1) THEN
        /* El kardex ya fue cerrado. */
        /* La data ya fue trasladada a inventario_almacenado */
        SELECT * FROM inventario_almacenado where periodo = vPeriodo;
        /* Para este caso, debido a que el kardex ya fue cerrado,
            no importa el valor de vCerrarKardex, puesto que el
            kardex no se volvera a abrir. */
    ELSE
        /* El kardex aun no ha sido cerrado. */
        IF (vCerrarKardex = 1) THEN
            /* TODO BORRAR TODOS LOS REGISTROS DEL MES */
            DELETE FROM inventario_almacenado WHERE periodo = vPeriodo;
            /* Se traslada la data a la tabla inventario_almacenado */
            INSERT INTO inventario_almacenado
            SELECT * FROM (
                SELECT vPeriodo periodo,
                    I.id, A.id articulo_id, A.codigo_articulo, A.nombre, A.unidad,
                    DATE_FORMAT(vFecha ,'01/%m/%Y') fecha, '' tipo_documento, '' serie_documento, '' numero_documento,
 'Saldo Inicial' tipo_operacion,
            /*IF(I.cantidad > 0, I.cantidad, 0) ingreso_cantidad,
            IF(I.cantidad > 0, I.costo_unitario, 0) ingreso_costo_unitario,
            IF(I.cantidad > 0, I.costo_total, 0) ingreso_costo_total,*/
            I.final_cantidad ingreso_cantidad,
            I.final_costo_unitario ingreso_costo_unitario,
            I.final_costo_total ingreso_costo_total,
            /*IF(I.cantidad < 0, I.cantidad * (- 1), 0)*/ '0' egreso_cantidad,
            /*IF(I.cantidad < 0, I.costo_unitario, 0) */ '0' egreso_costo_unitario,
            /*IF(I.cantidad < 0, I.costo_total, 0)*/ '0' egreso_costo_total,
            I.final_cantidad,
            I.final_costo_unitario,
            I.final_costo_total
                FROM inventario I
                    INNER JOIN (SELECT MAX(id) id FROM inventario WHERE fecha < DATE_FORMAT(vFecha ,'%Y-%m-01') AND inventario.final_cantidad > 0 GROUP BY articulo_id) AUX ON I.id = AUX.id
                    INNER JOIN articulo A ON I.articulo_id = A.id
                UNION
                SELECT 
                vPeriodo periodo,
                    I.id, A.id articulo_id, A.codigo_articulo, A.nombre, A.unidad,
                    DATE_FORMAT(I.fecha,'%d/%m/%Y') fecha, 
                     /*ITD.codigo tipo_documento,*/
                    IF(I.inventario_tipo_origen_id = 20, ((SELECT IF(ISNULL(guia_remision.factura_id), '09', '01') FROM guia_remision LEFT JOIN factura ON guia_remision.factura_id = factura.id JOIN despacho ON guia_remision.despacho_id = despacho.id WHERE despacho.id = I.entidad_id)),ITD.codigo) tipo_documento,
                    /*SERIE*/
                    /*CARPETA IMPORTACION*/
                     IF(I.inventario_tipo_origen_id = 1 , LEFT(IFNULL(fun_carpeta_importacion_numero_serie(I.inventario_documento_id)  ,''),LOCATE('-', IFNULL( fun_carpeta_importacion_numero_serie(I.inventario_documento_id),''))-1)
                    /*SI ES DESPACHO*/
                    ,IF(I.inventario_tipo_origen_id = 20, ((SELECT IF(ISNULL(factura.serie), guia_remision.serie, factura.serie) FROM guia_remision LEFT JOIN factura ON guia_remision.factura_id = factura.id JOIN despacho ON guia_remision.despacho_id = despacho.id WHERE despacho.id = I.entidad_id)) 
                    /*SI ES DOCUMENTO MANUAL*/
                    ,IF(I.inventario_tipo_origen_id = 21,  (SELECT inventario_documento_manual.serie FROM inventario_documento_manual WHERE inventario_documento_manual.id = I.entidad_id LIMIT 1)
                    /*DE LO CONTRARIO*/
                    ,0))) as serie_documento,    
                    
                    /*NUMERO*/
                    /*CARPETA IMPORTACION*/
