CREATE DEFINER=`holinsys`@`%` PROCEDURE `usp_reporte_order_backlog`(IN `vFecha` DATETIME, IN `vCerrarOrderBacklog` INT)
BEGIN
    DECLARE vCreado INT;
    DECLARE vMes INT;
    DECLARE vAnio INT;
    DECLARE vPeriodo VARCHAR(6);
    SET @item := 0;
    SET vCreado = 0;
    SET vMes = MONTH(vFecha);
    SET vAnio = YEAR(vFecha);
    SET vPeriodo = CONVERT(DATE_FORMAT(vFecha ,'%Y%m'), UNSIGNED INTEGER);
    
    /* Verificación  si del order backlog para el periodo dado ha sido cerrado. */
    SELECT cerrado_order_backlog INTO vCreado
    FROM inventario_mes
    WHERE mes = vMes AND anio = vAnio;
    
    IF (vCreado = 1) THEN
    
        /* El order backlog ya fue cerrado. */
        /* La data ya fue trasladada a reporte_order_backlog */
        SELECT * FROM reporte_order_backlog where fechaPeriodo=STR_TO_DATE( CONCAT('01/',vMes,'/',vAnio), '%d/%m/%Y %T');
       
        /* Para este caso, debido a que el order backlog ya fue cerrado,
            no importa el valor de vCerrarOrderBacklog, puesto que el
            order Backlog no se volvera a abrir. */
       
    ELSE
    
        /* El order Backlog aun no ha sido cerrado. */
        IF (vCerrarOrderBacklog = 1) THEN


            /* Se cierra el order Backlog */
            UPDATE inventario_mes SET cerrado_order_backlog = 1 WHERE mes = vMes AND anio = vAnio;
           
            /* Se traslada la data a la tabla reporte_order_backlog */
            INSERT INTO reporte_order_backlog (item,cliente,num_orden,articulo,moneda,valor,year_related,month_related,detalles,fechaPeriodo)
            SELECT (@item := @item + 10),cliente.nombre,cotizacion.orden_compra_cliente,if(cotizacion.categoria_id=1,cotizacion.poducto_type,'Servicios') nombre,cotizacion.moneda,sum(if(cotizacion.estado_id=8,(cotizacion_detalle.sub_total*-1),cotizacion_detalle.sub_total)),year(cotizacion.fecha),month(cotizacion.fecha),CONCAT(IFNULL(cotizacion.comentario_oi,""),IF((cotizacion_detalle.sub_total - (select sum(precio_unitario) from factura_detalle where factura_id= factura.id and articulo_id=cotizacion_detalle.articulo_id))=0,"",concat("Pre abono por ",cotizacion.moneda," ", (select sum(precio_unitario)  from factura_detalle where factura_id= factura.id and articulo_id=cotizacion_detalle.articulo_id)))),STR_TO_DATE( CONCAT('01/',vMes,'/',vAnio), '%d/%m/%Y %T')
