                                 ))or((cotizacion.fecha_cancelacion_cliente < STR_TO_DATE(CONCAT('01/',vMes,'/',vAnio), '%d/%m/%Y %T')) and cotizacion.estado_id=8)
                            group by cotizacion.orden_compra_cliente;
       
            INSERT INTO reporte_order_intake (cliente,moneda,valor,year_related,month_related)
            select "Holinsys_resumen_reporte",moneda,cambio,year(fecha),month(fecha) from tipo_cambio
