                                 where factura.centro_costo_id =centro_costo.id and (((select sum(cd.sub_total) from cotizacion_detalle cd where cd.cotizacion_id=cotizacion.id)-(select sum(precio_unitario) from factura_detalle where factura_id= factura.id))=0)
                                 ))or((cotizacion.fecha_cancelacion_cliente < STR_TO_DATE(CONCAT('01/',vMes,'/',vAnio), '%d/%m/%Y %T')) and cotizacion.estado_id=8)
                            group by cotizacion.orden_compra_cliente;
       
    END IF;
